using System.ComponentModel;
using System.Linq;
using System.Numerics;
using System.Text.RegularExpressions;

namespace ProjectEuler.Solvers
{
	[Description("Find the value of d < 1000 for which 1/d contains the longest recurring cycle.")]
	public class Problem026Solver : IProblemSolver
	{
		private static readonly BigInteger _bigNum = BigInteger.Pow(10, 2000);

		public string Execute()
		{
			var patterns = Enumerable
				.Range(1, 999)
				.Select(i =>
				        	{
				        		var pattern = Regex.Replace((_bigNum / i).ToString(), "0+$", string.Empty);
				        		return new
				        			{
										Number = i,
										Repeat = FindRepeat(pattern),
				        				Pattern = pattern
				        			};
				        	});

			var biggest = patterns.OrderByDescending(p => p.Repeat.Length).First();

			return string.Format("Number: {0} - Repeat Length {1}",
			                     biggest.Number,
			                     biggest.Repeat.Length);
		}

		private static string FindRepeat(string pattern)
		{
			for (var start = 0; start < pattern.Length; start++)
			{
				var index = 0;
				for (var len = 1; index >= 0 && len < pattern.Length - start; len++)
				{
					var findPattern = pattern.Substring(start, len);
					index = pattern.IndexOf(findPattern, start + len);
					if (index == start + len)
					{
						return findPattern;
					}
				}
			}

			return string.Empty;
		}
	}
}

